import React,{Component} from 'react';

function TopNavRightIcon(props) {
    
    return (
        <a
            href={props.member.href}
            title={props.member.title}
            id={props.member.id}
        >
            {props.member.media}
            <i
                className={props.member.className}
            >

            </i>
        </a>
    );
};

export default TopNavRightIcon;
